import Vue from 'vue'
import App from './App.vue'
import '@/assets/css/tailwind.css'
import 'remixicon/fonts/remixicon.css'
import { VueContext } from 'vue-context';

Vue.config.productionTip = false
Vue.use(VueContext)
new Vue({
  render: h => h(App),
}).$mount('#app')
